@iggied
Naw, I simply cannot reproduce the issue and no one has managed to create a simple repro.
The vars `freeGlobal`, `freeSelf`, and `freeWindow` have the `.Object` guards.

I am still seeing this occur inside of lodash 3.10.1

`var arrayProto = Array.prototype,  TypeError: Cannot read property 'prototype' of undefined`

Source :

```
  var arrayProto = Array.prototype,
        objectProto = Object.prototype,
        stringProto = String.prototype;
```

Then I see there is a guard being created specifically for loadash in my "browsered" js file : 

```
    // Avoid issues with some ES3 environments that attempt to use values, named
    // after built-in constructors like `Object`, for the creation of literals.
    // ES5 clears this up by stating that literals must use built-in constructors.
    // See https://es5.github.io/#x11.1.5 for more details.
    context = context ? _.defaults(root.Object(), context, _.pick(root, contextProps)) : root;
```

Can I remove this guard someone through configuration?
